import React from "react";
// import SelectedNote from "./SelectedNote";

import "./Sidebar.css";

const Sidebar = (props) => {
  return (
    <aside className="sidebar">
      <button type="button" className="button block tertiary header-text">
        Create Note
      </button>
      <ul>
        {props.notes.map((note, i) => (
          <li className="active" key={note.header} onClick={onNote}>
            <h3 className="header-text no-margin">{note.header}</h3>
            <p className="body-text no-margin muted">
              {note.timestamp}
            </p>
          </li>
        ))}
      </ul>
    </aside>
  );
};

export default Sidebar;
